Veja como é a semana de um Católico, Devoção de cada dia da semana: 
Domingo - Dia do Senhor, Dedicado à Ressurreição de Cristo e à Santíssima Trindade;
Segunda - Dedicado as almas do purgatório;
Terça - Santos Anjos;
Quarta - São José;
Quinta - Santíssimo Sacramento;
Sexta - A Paixão de Cristo e ao Sagrado Coração de Jesus;
Sábado - À Nossa Senhora e ao Imaculado Coração de Maria.
